class CalendarPopup():

    def __init__(self, master, callback = None):

        self.master = master
        self.popup = tk.Toplevel(master)
        self.popup.title("Select Start and End Date")
        self.popup.geometry("600x300")
        self.popup.resizable(False, False)

        self.start_date = tk.Label(self.popup, text = "Start Date: ", font = ("Mulish", 9))
        self.start_date.place(x = 20, y = 20)

        self.end_date = tk.Label(self.popup, text = "End Date: ", font = ("Mulish", 9))
        self.end_date.place(x = 330, y = 20)

        self.cal = Calendar(self.popup, selectmode="day", date_pattern="y-mm-dd")
        self.cal.pack(padx=20, pady=20)
        self.cal.place(x=20, y=40)

        self.cal2 = Calendar(self.popup, selectmode="day", date_pattern="y-mm-dd")
        self.cal2.pack(padx=20, pady=20)
        self.cal2.place(x=330, y=40)

        self.close_button = ttk.Button(self.popup, text="Close", command=self.get_selected_date)
        self.close_button.pack(pady=10)
        self.close_button.place(x = 300, y = 270, anchor = 'c')

        self.callback  = callback

    def get_selected_date(self):
        selected_date = self.cal.get_date()
        selected_date2 = self.cal2.get_date()
        if self.callback:
            self.callback(selected_date, selected_date2)
        self.popup.destroy()

class CalendarPopup2():

    def __init__(self, master, callback = None):

        self.master = master
        self.popup = tk.Toplevel(master)
        self.popup.title("Select Start and End Date")
        self.popup.geometry("300x300")
        self.popup.resizable(False, False)

        self.start_date = tk.Label(self.popup, text = "Choose Date to View: ", font = ("Mulish", 9))
        self.start_date.place(x = 20, y = 20)

        self.cal = Calendar(self.popup, selectmode="day", date_pattern="y-mm-dd")
        self.cal.pack(padx=20, pady=20)
        self.cal.place(x=20, y=40)

        self.close_button = ttk.Button(self.popup, text="Close", command=self.get_selected_date)
        self.close_button.pack(pady=10)
        self.close_button.place(x = 150, y = 270, anchor = 'c')

        self.callback  = callback

    def get_selected_date(self):
        selected_date = self.cal.get_date()
        if self.callback:
            self.callback(selected_date)
        self.popup.destroy()

